import React from 'react';
import Button from '@mui/material/Button';
import ImageGrid from './ImageGrid';

function Get_Started() {
    return (
        <main style={{ display: 'flex', justifyContent: 'flex-end', alignItems: 'center', height: '90vh' }}>
            <ImageGrid />
            <div >ArtisticAlly: A platform to connect with artists and job oppurtunities!</div>
            <br></br>
            <Button
                variant="contained"
                style={{
                    fontSize: '4rem',
                    background: 'linear-gradient(45deg, #9C27B0 30%, #2196F3 90%)', // Purple to blue gradient
                    color: '#fff',
                    borderRadius: '50px',
                    textTransform: 'capitalize',
                    marginRight: '50px',
                    fontFamily: 'Montserrat, sans-serif',
                }}
            >
                Welcome!
            </Button>
        </main >
    );
}

export default Get_Started;
